import React from 'react'
import '../styles.css'
import { useEffect, useState, useRef } from 'react'
import FileDownloadOffIcon from '@mui/icons-material/FileDownloadOff';
import FileDownloadIcon from '@mui/icons-material/FileDownload';
import UploadFileIcon from '@mui/icons-material/UploadFile';


const Script = () => {

    const [imageSrc, setImageSrc] = useState('');
    const isFirstRender = useRef(true);
    const [file, setFile] = useState(null);
    const canvasRef = useRef(null);
    const animationFrameRef = useRef(null);
    const [isLoading, setIsLoading] = useState(true);




    const handleFileChange = (event) => {
        setFile(event.target.files[0]);
    };

    useEffect(() => {
        if (!file) {
            return;
        }

        if (!isLoading) {
            setIsLoading(true);
        }

        const canvas = document.createElement("canvas");
        const ctx = canvas.getContext("2d");

        const img = new Image();
        img.src = URL.createObjectURL(file);
        img.onload = () => {
            canvas.width = 500;
            canvas.height = 500;
            ctx.drawImage(img, 0, 0, canvas.width, canvas.height);
            const dataURL = canvas.toDataURL();
            setImageSrc(dataURL);
        };
    }, [file]);

    useEffect(() => {
        if (!canvasRef.current) {
            return;
        }

        const canvas = canvasRef.current;
        const ctx = canvas.getContext('2d');
        canvas.width = 500;
        canvas.height = 500;

        const placeholderImage = new Image();
        placeholderImage.src = "data:image/png;base64,"
        placeholderImage.onload = () => {
            const canvas = canvasRef.current;
            const ctx = canvas.getContext("2d")
            canvas.width = 500;
            canvas.height = 500;

            ctx.drawImage(placeholderImage, 0, 0, canvas.width, canvas.height);
            const pixels = ctx.getImageData(0, 0, canvas.width, canvas.height);
            ctx.clearRect(0, 0, canvas.width, canvas.height);

            placeholderImage.onerror = (error) => {
                console.log(`Error loading image: ${error}`);
            };

            let particlesArray = [];
            const numberOfParticles = 5000;

            let mappedImage = [];
            for (let y = 0; y < canvas.height; y++) {
                let row = [];
                for (let x = 0; x < canvas.width; x++) {
                    const red = pixels.data[(y * 4 * pixels.width) + (x * 4)];
                    const green = pixels.data[(y * 4 * pixels.width) + (x * 4 + 1)];
                    const blue = pixels.data[(y * 4 * pixels.width) + (x * 4 + 2)];
                    const brightness = calculateRelativeBrightness(red, green, blue);
                    const cell = [
                        brightness,
                    ];
                    row.push(cell);
                }
                mappedImage.push(row);
            }

            function calculateRelativeBrightness(red, green, blue) {
                return Math.sqrt(
                    (red * red) * 0.299 +
                    (green * green) * 0.587 +
                    (blue * blue) * 0.114
                ) / 100;
            }


            class Particle {
                constructor() {
                    this.x = Math.random() * canvas.width;
                    this.y = 0;
                    this.speed = 0;
                    this.velocity = Math.random() * 1.5;
                    this.size = Math.random() * 1.5 + 1;
                    this.position1 = Math.floor(this.y);
                    this.position2 = Math.floor(this.x);
                }
                update() {
                    this.position1 = Math.floor(this.y);
                    this.position2 = Math.floor(this.x);
                    this.speed = mappedImage[this.position1][this.position2][0];
                    let movement = (2.5 - this.speed) + this.velocity;

                    this.y += movement;
                    if (this.y >= canvas.height) {
                        this.y = 0;
                        this.x = Math.random() * canvas.width;
                    }
                }
                draw() {
                    ctx.beginPath();
                    ctx.fillStyle = 'white';
                    ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
                    ctx.fill();
                }
            }
            function init() {
                for (let i = 0; i < numberOfParticles; i++) {
                    particlesArray.push(new Particle);
                }
            }
            init();
            function animate() {

                ctx.globalAlpha = 0.05;
                ctx.fillStyle = 'rgb(0, 0, 0';
                ctx.fillRect(0, 0, canvas.width, canvas.height);
                ctx.globalAlpha = 0.2;
                for (let i = 0; i < particlesArray.length; i++) {
                    particlesArray[i].update();
                    ctx.globalAlpha = particlesArray[i].speed * 0.25;
                    particlesArray[i].draw();
                }
                animationFrameRef.current = requestAnimationFrame(animate);
                //requestAnimationFrame(animate);
            }
            animate();
        };
    }, []);



    useEffect(() => {

        if (!canvasRef.current || !imageSrc) {
            console.log("Hey there! Happy to see you are interested in PixelFlow. Feel free to reach out to me for any suggestions on how to improve it <3")
            return;
        }

        console.log("lets start")

        const myImage = new Image()
        myImage.src = imageSrc

        myImage.onload = () => {

            if (animationFrameRef.current) {
                cancelAnimationFrame(animationFrameRef.current);
                animationFrameRef.current = null;
            }

            const canvas = canvasRef.current;
            const ctx = canvas.getContext("2d")
            canvas.width = 500;
            canvas.height = 500;

            ctx.drawImage(myImage, 0, 0, canvas.width, canvas.height);
            const pixels = ctx.getImageData(0, 0, canvas.width, canvas.height);
            ctx.clearRect(0, 0, canvas.width, canvas.height);

            myImage.onerror = (error) => {
                console.log(`Error loading image: ${error}`);
            };

            let particlesArray = [];
            const numberOfParticles = 5000;

            let mappedImage = [];
            for (let y = 0; y < canvas.height; y++) {
                let row = [];
                for (let x = 0; x < canvas.width; x++) {
                    const red = pixels.data[(y * 4 * pixels.width) + (x * 4)];
                    const green = pixels.data[(y * 4 * pixels.width) + (x * 4 + 1)];
                    const blue = pixels.data[(y * 4 * pixels.width) + (x * 4 + 2)];
                    const brightness = calculateRelativeBrightness(red, green, blue);
                    const cell = [
                        brightness,
                    ];
                    row.push(cell);
                }
                mappedImage.push(row);
            }
            console.log("mapped Image done")

            function calculateRelativeBrightness(red, green, blue) {
                return Math.sqrt(
                    (red * red) * 0.299 +
                    (green * green) * 0.587 +
                    (blue * blue) * 0.114
                ) / 100;
            }


            class Particle {
                constructor() {
                    this.x = Math.random() * canvas.width;
                    this.y = 0;
                    this.speed = 0;
                    this.velocity = Math.random() * 1.5;
                    this.size = Math.random() * 1.5 + 1;
                    this.position1 = Math.floor(this.y);
                    this.position2 = Math.floor(this.x);
                }
                update() {
                    this.position1 = Math.floor(this.y);
                    this.position2 = Math.floor(this.x);
                    this.speed = mappedImage[this.position1][this.position2][0];
                    let movement = (2.5 - this.speed) + this.velocity;

                    this.y += movement;
                    if (this.y >= canvas.height) {
                        this.y = 0;
                        this.x = Math.random() * canvas.width;
                    }
                }
                draw() {
                    ctx.beginPath();
                    ctx.fillStyle = 'white';
                    ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2);
                    ctx.fill();
                }
            }
            function init() {
                for (let i = 0; i < numberOfParticles; i++) {
                    particlesArray.push(new Particle);
                }
            }
            init();
            console.log("init done")
            function animate() {

                ctx.globalAlpha = 0.05;
                ctx.fillStyle = 'rgb(0, 0, 0';
                ctx.fillRect(0, 0, canvas.width, canvas.height);
                ctx.globalAlpha = 0.2;
                for (let i = 0; i < particlesArray.length; i++) {
                    particlesArray[i].update();
                    ctx.globalAlpha = particlesArray[i].speed * 0.25;
                    particlesArray[i].draw();
                }
                animationFrameRef.current = requestAnimationFrame(animate);
                //requestAnimationFrame(animate);
            }
            animate();
            console.log("animation done")
            startRecording();
            console.log("done recording")
            function startRecording() {
                const chunks = [];
                const stream = canvas.captureStream();
                const rec = new MediaRecorder(stream);
                rec.ondataavailable = e => chunks.push(e.data);
                rec.onstop = e => exportVid(new Blob(chunks, { type: 'video/webm' }));

                rec.start();
                setTimeout(() => rec.stop(), 8000);
            }

            function exportVid(blob) {
                const vid = document.createElement('video');
                vid.src = URL.createObjectURL(blob);
                vid.controls = true;

                const a = document.getElementById('link');
                a.download = 'myvid.webm';
                a.href = vid.src;
                setIsLoading(false);
            }
        }


    }, [canvasRef, imageSrc])

    return (
        <main className='main'>
            <h1 className='text'>PixelFlow</h1>
            <h2 className='text'>Transform Your Images into Mesmerizing Animations!</h2>
            <div className='canvas-container'>
                <canvas className='canvas' ref={canvasRef} />
                <div className='button-wrapper'>
                    <label className="file-input-wrapper">
                        <input type="file" accept="image/*" onChange={handleFileChange} style={{ display: 'none' }} />
                        <UploadFileIcon className='upload-icon' />
                        Upload Image
                    </label>

                    <a id='link' className={'link'}>
                        {isLoading ? <FileDownloadOffIcon className='download-icon' />
                            :
                            <FileDownloadIcon className='download-icon' />}
                        Download
                    </a>
                </div>
            </div>
        </main>
    )
}

export default Script